import React from "react";
import "./Home.css";
import bannerImage from "./images/banner-1.jpg";
import Product from "./Product";

function Home() {
	return (
		<div className="home">
			<div className="home__container">
				<img className="home__image" src={bannerImage} alt="banner-image" />
				<div className="home__row">
					<Product
						id="4903850"
						title="New Apple Watch Series 6 (GPS, 40mm) - Space Gray Aluminum Case with Black Sport Band"
						price={499.99}
						rating={4}
						image="https://images-na.ssl-images-amazon.com/images/I/71yOGVLGWpL._AC_SX679_.jpg"
					/>
					<Product />
				</div>
				<div className="home__row">
					<Product />
					<Product />
					<Product />
				</div>
				<div className="home__row">
					<Product />
				</div>
			</div>
		</div>
	);
}

export default Home;
